import ShowResult from "./ShowResult/ShowResult";

const FinalResume = () => {
  const fullname = localStorage.getItem("Fullname")
    ? JSON.parse(localStorage.getItem("Fullname"))
    : [];
  const bio = localStorage.getItem("Bio")
    ? JSON.parse(localStorage.getItem("Bio"))
    : [];
  const skills = localStorage.getItem("Skills")
    ? JSON.parse(localStorage.getItem("Skills"))
    : [];
  const education = localStorage.getItem("Education")
    ? JSON.parse(localStorage.getItem("Education"))
    : [];

  const experience = localStorage.getItem("Experience")
    ? JSON.parse(localStorage.getItem("Experience"))
    : [];
  const objectives = localStorage.getItem("Objectives")
    ? JSON.parse(localStorage.getItem("Objectives"))
    : [];
  return (
    <>
      <h2>Your Detail Information</h2>
      {fullname} <br />
      <br />
      {bio} <br />
      <br />
      {skills.map((data) => (
        <>
          <b>{data}</b>
          <br />
        </>
      ))}
      <br />
      <br />
      {education[0].Name} <br />
      {education[0].YOC} <br />
      {education[0].Des} <br />
      <br />
      {education[1].Name} <br />
      {education[1].YOC} <br />
      {education[1].Des} <br />
      <br />
      {experience}
      {objectives}
      <br />
    </>
  );
};
export default FinalResume;
